import logo from './logo.svg';
import './App.css';

function MyButton(){
  const link="https://www.google.com"

  return(
    <button className="googlebutton">
      <a href={link}>
      MyGoogleButton
        </a> 
    </button>
  )
}

function App() {
  const title = 'Welcome to the new blog';
  const likes = 50;
  return (
    <div className="App">
      <div className="content">
        <h1>{ title }</h1>
        <p>Liked { likes } times</p>
        <MyButton/> <p>
          "You have clicked this button" + {Math.random *10} + " times most probably."
        </p>
      </div>
    </div>
  );
}


export default App;
